export const useExampleData  = () => {
    const [exampleData, setExampleData] = useState([{id: 0, state: "Ausgaben", date: {day: 1, month: 3, year: 20223}, amount: 12.56, bankBalance:85.36},
                                                    {id: 1, state: "Einkommen", date: {day: 1, month: 3, year: 2023}, amount: 20, bankBalance:85.36}])
    
    return exampleData, setExampleData
}

